import Banner from "../components/Banner";
import "../styles/FlatPage.css"
import banner1 from "../assets/images/banner-1.png";
import FlatList from "../components/FlatList";
import Tag from "../components/Tag";
import Dropdown from "../components/Dropdown";

class FlatPage extends React.Component {

    render() {
        return <>
            <div className="flat-page__header">
                <div className="title-and-tags">
                    <h2 className="title"> Cosy place chepakoi </h2>
                    <p className="subtitle">blablabla</p>
                    <Tag content="tag" />
                </div>

            </div>
            <div className="flat-page__main">
                <Dropdown description title="description" text="les gens" className="flat-dropdown"/>
                <Dropdown equipment title="equipements" text="les gens" className="flat-dropdown"/>
            </div>
        </>

    }
}

export default FlatPage
